import styled from "styled-components";

export const PageContainer = styled.div`
  margin-top: 60px;
  min-height: 100%;
  display: flex;
  flex-direction: column;
`;

export const ProfileContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  max-width: 60%;
  margin: 0 auto;
  justify-content: center;
`;

export const Title = styled.h3`
  position: relative;
  color: #00008b;
  font-size: 4rem;
  font-weight: bold;
  text-align: center;
  margin-bottom: 2rem;
  padding-top: 2rem;
`;
